import React from "react";
import { Badge, TabBar } from 'antd-mobile'

const TabBarAction = function TabBarAction():React.JSX.Element{
    const tabs = [
        {
          key: 'home',
          title: '首页',
          icon: require('../assets/images/1.png'),
          badge: Badge.dot,
        },
        {
          key: 'todo',
          title: '待办',
          icon: require('../assets/images/1.png'),
          badge: '5',
        },
        {
          key: 'message',
          title: '消息',
          icon: require('../assets/images/1.png'),
          badge: '99+',
        },
        {
          key: 'personalCenter',
          title: '我的',
          icon: require('../assets/images/1.png'),
        },
      ]
}

export default TabBarAction;
